# The i/o program
def splitNumberReverse(line):
    line = str(line)
    return [line[::-1][i:i+3][::-1] for i in range(0, len(line), 3)]
def fourFourTheArray(arr):
    return [threeDigit[int(i)] * illions[ind] for (ind, i) in enumerate(arr)]
from functools import reduce
def prod(arr):
    arr = [x for x in arr if x > 0]
    return reduce(lambda x, y: x*y, arr)
def fourFour(n):
    a = splitNumberReverse(str(n))
    b = fourFourTheArray(a)
    return prod(b)

